import './App.css';

function App() {
  return (
    <div className="App">
      <header>
          <div class="logo">Movie Maniac</div>
          <nav>      
            <ul>
              <li>Home</li>
              <li>New</li>
              <li>Popular</li>
              <li>Watchlist</li>
            </ul>
          </nav>
      </header>


    </div>
  );
}

export default App;
